Back to accessibility
Overview
For something to be accessible someone needs to be able to complete the task they are trying to achieve without encountering a barrier or issue.


The 4 principles


the information that the user needs must be perceivable to them
the webpage need to be operable
the information that the user needs must be understandable to them
the webpage needs to be robust

These are implemented through the Web Content Accessibility Guidelines (WCAG).
As a public sector body, we are required to ensure our services meet WCAG 2.1 (opens in new tab) AA.


WCAG 2.2 (Draft)
There is a draft version of WCAG 2.2 (opens in new tab) which is due to be published shortly. This has new guidelines and some may impact services being developed now.

